import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "./MentorRegisterPage.css";
import FooterBar from "./FooterBar";

function MentorRegisterPage() {
  const [mentorForm, setMentorForm] = useState({
    fullName: "",
    email: "",
    contactNumber: "",
    employeeId: "",
    dob: "",
    password: "",
    confirmPassword: "",
  });

  const [formErrors, setFormErrors] = useState({
    fullName: false,
    email: false,
    contactNumber: false,
    employeeId: false,
    dob: false,
    password: false,
    confirmPassword: false,
  });

  const navigate = useNavigate();

  const handleMentorFormChange = (event) => {
    const { name, value } = event.target;
    setMentorForm((prevForm) => ({ ...prevForm, [name]: value }));
    setFormErrors((prevErrors) => ({ ...prevErrors, [name]: false }));
  };

  const handleMentorFormSubmit = (event) => {
    event.preventDefault();
    let errors = {};

    Object.keys(mentorForm).forEach((key) => {
      if (!mentorForm[key]) {
        errors[key] = true;
      }
    });

    if (Object.keys(errors).length > 0) {
      setFormErrors(errors);
    } else {
      // TODO: handle form submission
      history.push("/mentor-sign-in-page");
    }
  };

  return (
    <center>
      <div style={{ backgroundColor: "grey" }}>
        <div className="container">
          <div className="form-container">
            <form onSubmit={handleMentorFormSubmit}>
              <h2>Register as Mentor</h2>
              <label>
                Full Name:
                <input
                  type="text"
                  name="fullName"
                  value={mentorForm.fullName}
                  onChange={handleMentorFormChange}
                  required
                />
                {formErrors.fullName && (
                  <span className="error">This field is required</span>
                )}
              </label>
              <label>
                Enterprise Email Id:
                <input
                  type="email"
                  name="email"
                  value={mentorForm.email}
                  onChange={handleMentorFormChange}
                  required
                />
                {formErrors.email && (
                  <span className="error">This field is required</span>
                )}
              </label>
              <label>
                Contact Number:
                <input
                  type="tel"
                  name="contactNumber"
                  value={mentorForm.contactNumber}
                  onChange={handleMentorFormChange}
                  required
                />
                {formErrors.contactNumber && (
                  <span className="error">This field is required</span>
                )}
              </label>
              <label>
                Employee Id:
                <input
                  type="text"
                  name="employeeId"
                  value={mentorForm.employeeId}
                  onChange={handleMentorFormChange}
                  required
                />
                {formErrors.employeeId && (
                  <span className="error">This field is required</span>
                )}
              </label>
              <label>
                Date of Birth:
                <input
                  type="date"
                  name="dob"
                  value={mentorForm.dob}
                  onChange={handleMentorFormChange}
                  required
                />
                {formErrors.dob && (
                  <span className="error">This field is required</span>
                )}
              </label>
              <label>
                Password:
                <input
                  type="password"
                  name="password"
                  value={mentorForm.password}
                  onChange={handleMentorFormChange}
                  required
                />
                {formErrors.password && (
                  <span className="error">This field is required</span>
                )}
              </label>
              <label>
                Confirm Password:
                <input
                  type="password"
                  name="confirmPassword"
                  value={mentorForm.confirmPassword}
                  onChange={handleMentorFormChange}
                  required
                />
                {formErrors.confirmPassword && (
                  <span className="error">This field is required</span>
                )}
              </label>
              <button type="submit">Register</button>
              <p>
                Already have an account?{" "}
                <Link to="/mentor-sign-in-page">Sign In</Link>
              </p>
            </form>
          </div>
        </div>
        <FooterBar />
      </div>
    </center>
  );
}

export default MentorRegisterPage;
